import prev_btn from "../statics/prev-task-btn.svg";
import next_btn from "../statics/next-task-btn.svg";

export default function TaskNavigation(props) {
    return <div className="task-navigation-container">
        <button className="prev-task" onClick={props.handleNavifationButtonClick('prev')} style={{ display: "flex", flexDirection: "row" }}><img id="prev-btn-img" src={prev_btn} alt="."></img> Previous Task</button>
        <button className="next-task" onClick={props.handleNavifationButtonClick('next')}>Next Task</button>
    </div>
}
